import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

import Home from './components/Home';
import Cities from './components/Cities'

function App() {
  return (
    <Router>
      <div className="App">
        <switch>
          <Route path="/" exact>
            <Home />
          </Route>
          <Route path="/cities">
            <Cities />
          </Route>
        </switch>
      </div>
    </Router>
  );
}

export default App;
